import { useNavigate } from "react-router-dom";
import BottomSignup from "../components/BottomSignup.js";
import Button from "../components/Button.js";
import FindButton from "../components/FindButton.js";
import Header from "../components/Header.js";
import InputText from "../components/InputText.js";
import "./Login.css";

const Login = () => {
    const navigate = useNavigate();
    const onClickSignup = () => {
        navigate('./signup');
    }
    return (
        <div className="LOGIN">
            <Header className="LOGIN_TITLE" text={"LOGIN"} />
            <InputText text={"ID"} type={"text"} />
            <InputText text={"PASSWORD"} type={"password"} />
            <Button text={"로그인"} />
            <FindButton />
            <BottomSignup />
        </div>
    );
};

export default Login;
